INSERT INTO Dialogs VALUES (1844,0,'updatedescription','EN','Use this form to update the remaining messages on your address (0 to 20). If you like, you can specify an exclusive sender (by email address or domain) who will be allowed to forward through the address indefinitely. The exclusive sender can be a full address (e.g., joe@example.com) or just a domain (e.g. example.com)\r\n<p>\r\nWhen the counter reaches zero, the address expires and eats all emails sent to it, except those from your trusted senders and the exclusive sender.',1,NULL);
INSERT INTO Dialogs VALUES (1845,0,'updatedescription','DE','Hier können Sie die Anzahl der noch verbleibenden Nachrichten (0 bis 20) verändern und ausschließliche Absender (per Adresse oder Domain) bestimmen, die Ihnen  diese Adresse unbegrenzt viele E-Mails schicken können. Im Gegensatz zu den vertrauenswürdigen Absendern kann diese Adresse <b>nur</b> von dem angegebenen Absender benutzt werden. \r\n',1,NULL);
INSERT INTO Dialogs VALUES (1846,0,'updatedescription','ES','Usa este formulario para cambiar el número de mensajes pendientes permitidos en este deshechable (0 a 20). Si quieres, puedes especificar un remitente exclusivo (por dirección de correo electrónico o dominio); los mensajes enviados por remitentes exclusivos son siempre reenviados. El remitente exclusivo puede ser una dirección completa (tal como miamigo@example.com) o simplemente un dominio (tal como example.com)\r\n\r\nCuando el contador llega a cero, la desechable devora todos los mensajes que lleguen, excepto aquellos que vengan de remitentes de confianza y exclusivos. ',1,1078312903);
INSERT INTO Dialogs VALUES (1847,0,'updatedescription','FR','Sur cette page, vous pouvez modifier le compteur de messages restant pour cette adresse (de 0 à 20). Si vous le souhaitez, vous pouvez spécifier un expéditeur exclusif qui peut vous envoyer des messages indéfiniment à cette adresse. L\'expéditeur exclusif peut être une adresse complète (par ex. jojo@exemple.com) ou bien juste un domaine (par ex. exemple.com).\r\n<p> \r\nQuand le compteur d\'une adresse atteint 0, l\'adresse expire, et elle mange tous les messages, sauf ceux venant de vos expéditeurs exclusifs et de vos expéditeurs autorisés.',1,NULL);
INSERT INTO Dialogs VALUES (1848,0,'updatedescription','NL','Gebruik dit formulier om uw overblijvende berichten te bewerken (0-20). Als u wilt kunt u een exclusieve zender specifieren (door Email adres of domein) deze zullen worden toegestaan om oneindig door het geselecteerde adres te sturen. Naast je vertrouwde zenders, alleen de exclusieve zenders zullen door het adres kunnen mailen nadat het is verlopen. ',1,NULL);
INSERT INTO Dialogs VALUES (1849,0,'updatedescription','NO','Bruk dette skjemaet for å oppdatere antall gjennværende meldinger på din adresse (0 til 20). Du kan også spesifisere en eksklusiv adresse (epost adresse eller domene) som får lov til å videresene gjennom adressen uten begrensninger. For uten dine betrodde avsendere vil kun den eksklusive adressen få lov til å bruke adressen når den går ut.',1,NULL);
INSERT INTO Dialogs VALUES (1850,0,'updatedescription','RO','Folositi acest formular pentru a va aduce la zi mesajele ramase pentru adresa volatila (de la 0 la 20). Daca doriti, puteti specifica un expeditor exclusiv (dupa adresa de email sau domeniu) caruia ii va fi ingaduit sa va trimita mesaje redirectionate fara limita de timp. In afara expeditorilor Dvs. de incredere, numai expeditorul excusiv ca avea permisiunea sa foloseasca o adresa volatila, dupa expirarea sa.',1,NULL);
INSERT INTO Dialogs VALUES (1851,0,'updatedescription','RU','Используйте эту форму чтобы обновить счетчик сообщений которые могу прийти на ваш адрес (от 0 до 20). Если желаете вы можете указать эксклюзивного отправителя (по адресу email или по домену) которому будет позволено слать неограниченное число сообщений на ваш одноразовый адрес. Кроме надежный отправителей, только эксклюзивный отправитель сможет использовать адрес после того как счетчик сообщений обнулится.',1,NULL);
INSERT INTO Dialogs VALUES (1852,0,'updatedescription','SV','Använd detta formulär för att uppdatera antalet återstående meddelanden för din adress (0 till 20). Om du vill kan du ange en exklusiv avsändare (med e-postadress eller e-postdomän) som kommer att ha tillstånd att skicka genom denna adress för evigt. Förutom dina anförtrodda avsändare är det bara den exklusiva avsändaren som får använda adressen efter att den har gått ut.',1,NULL);
INSERT INTO Dialogs VALUES (1853,0,'updatedescription','TR','Bu formu kullanarak bu adresin kalan ileti sayısını değiştirebilirsiniz (0 ilâ 20). İsterseniz bu adresten sınırsızca ileti göndermesini uygun bulduğunuz bir özgül gönderen belirleyebilirsiniz (e-posta adresine ya da etki alanına (domain) göre). Adresinizin kullanım sınırı aşıldıktan sonra bu adresi güvenilir gönderenlerin yanı sıra özgül gönderenler de kullanabilecektir. ',1,1076208708);
