INSERT INTO Dialogs VALUES (1923,0,'sendfromdescription','EN','This form will produce a special email address. Send mail to it and spamgourmet will forward the message to your recipient, making it look like the message came from the disposable address you specify.  This allows you to start an email dialog without giving away your real email address.  You can use an existing address or create a new one for the purpose.  If you use an existing address, it will be refilled to its maximum message count.  If you create a new address, your current prefix will be added to it, if you have one.  Using this form will also enable reply address masking if you do not already have it enabled.',1,1076608030);
