INSERT INTO Dialogs VALUES (1988,0,'sendfromdescription','DE','Dieses Formular erzeugt eine spezielle E-Mail-Adresse. Senden Sie eine E-Mail dorthin, und Spamgourmet wird sie so aussehen lassen, als käme Sie von der angegebenen Wegwerfadresse. Auf diese Art und Weise können Sie eine Konversation beginnen ohne Ihre echte E-Mail-Adresse offenzulegen. Sie können eine bestehende Adresse benutzen oder eine neue für diesen Zweck erzeugen. Falls Sie eine bestehende Adresse benutzen, wird der dazu gehörende Nachrichtenzähler auf das Maximum zurückgesetzt. Mit diesem Formular können Sie außerdem die Antwortmaskierung einschalten, wenn noch nicht geschehen.',1,1076453607);
