INSERT INTO Dialogs VALUES (2001,0,'sendfromdescription','ES','Este fomulario creará una dirección de correo especial. Envía correo a esta dirección, y spamgourmet reenviará el mensaje a tu corresponsal, de forma que parezca que el mensaje proviene de la dirección de correo deshechable que seleccionas. De esta forma puedes iniciar una correspondencia sin dar tu dirección de correo verdadera. Puedes o bien usar una deshechable existente o bien crear una nueva para éste propósito. Si usas una existente, el número de mensajes a recibir de la desechable se \"rellenará\" hasta el máximo que le fue asignado en su creación. Si creas una nueva, se incluirá en la misma tu prefijo en vigor, si lo tienes activado. Usando este formulario tambien podrás activar enmascaramiento de la dirección de correo del remitente, si no lo estuvier ya.',1,1078311939);
