INSERT INTO Dialogs VALUES (2046,0,'sendfromdescription','RU','С помощью этой формы вы можете создать специальный email адрес. Отправьте сообщение на него и СпамГурман перешлет его вашему получателю, таким образом что сообщение будет выглядеть как если бы оно было послано с одноразового адреса который вы здесь указали. Это позволяет вам начать диалог по email не раскрывая ваш реальный адрес. Вы можете использовать существующий одноразовый адрес или создать новый для этой цели. Если вы используете существующий адрес, счетчик будет \"подзаправлен\" до максимального значения. Используя эту форму, вы также включаете опцию \"маскировка адреса с которого вы отвечаете\", если она до сих пор не была у вас включена.',1,1076512839);
