INSERT INTO Dialogs VALUES (2064,0,'sendfromdescription','SV','Detta formulär kommer att skapa en speciell epostadress. Om du skickar e-post till den kommer spamgourmet att vidarebefordra meddelandet till mottagaren, och få det att se ut som om meddelandet kommer ifrån den disponibla adressen som du anger. Detta tillåter dig att starta en epostkonversation utan att ge ut din riktiga epostadress. Du kan använda en existerande adress eller skapa en ny för ändamålet. Om du använder en existerande adress kommer den att fyllas upp till sitt maxantal för skickade meddelanden. Om du skapar en ny adress kommer ditt nuvarande prefix att läggas till till den, ifall du har ett. Om du använder detta formulär kommer dessutom svarsadressmaskering att aktiveras ifall det inte redan är aktiverat.',1,1077103349);
