INSERT INTO Dialogs VALUES (2442,0,'updatedescription','PT','Use este formulário para atualizar a quantidade de mensagens para seu endereço ( de 0 a 20). Se preferir, você pode especificar um remetente exclusivo (por endereço de e-mail ou  domínio) que terá suas mensagens encaminhadas para sempre. O remetente pode ser um endereço completo ( tipo  joe@exemplo.com) ou só o domínio (como exemplo.com)<p> Quando o contador chegar a zero, o endereço expira e devora todos outros e-mails enviados para ele, exceto aquelas dos remetentes confiáveis e exclusivos.',1,1099660886);
