INSERT INTO Dialogs VALUES (2459,0,'sendfromdescription','PT','Este formulário vai produzir um endereço de e-mail especial. Mande um e-mail para ele e o spamgourmet encaminhará a mensagem para o destinatário, fazendo parecer que veio do seu e-mail descartável que você especificou. Isto permite começar uma troca de e-mails sem fornecer seu endereço real. Você pode usar um endereço já existente ou criar um novo para isso. Se estais usando um que já existe, será redefinido para o máximo de mensagens possível. Se você usar prefixos, ao criar um endereço novo, seu prefixo atual será adicionado para ele. E usando este formulário vai também ativar o mascaramento do endereço de resposta se não estiver ativado.',1,1099665064);
