INSERT INTO Dialogs VALUES (2497,0,'updatedescription','ZH','请使用本表格更新可丢弃电邮地址的余下使用次数(0至20)。如果您喜欢的话可以指定「获豁免寄件者」。获豁免寄件者可以无限次传送电邮到您的可丢弃电邮地址而该地址的剩余次数不会減少。获豁免寄件者可以全个电邮地址指定 (例如 joe@example.com) 或以域名指定 (例如 example.com) <p> 当「尚余前转封数」被遞減至零的时候該地址便会失效，除非电邮由被信任的寄件者或获豁免寄件者寄出，否则所有传送到该地址的电邮都会被吃掉。',1,1100646662);
