INSERT INTO Dialogs VALUES (2503,0,'sendfromdescription','ZH','您可以用这个表格制作一个可丟弃电邮地址，当您传送电邮到这个地址的时候美味垃圾电邮站伝前转一份给收件者，並修改电邮的註腳，令邮件看似由这个可丟弃电邮地址寄出。这样您便可以不必公开您的真实电邮地址。您可以使用一个现有的地址或建立一个新的。如果您使用一个现有的，「尚余前转封数」将被增加至「最高前转封数」。如果您建立一个新地址，亦如果您有设定字首的话，字首将会被加到电邮地址之前。还有，如果您没有启用「遮蔽回复地址」选，使用这个表格将会启用该选项。',1,1100648066);
